id:
A JSON `STRUCTURE` for configuring static website hosting.
	Example:
	{
		"ErrorDocument": {
			"Key": "error.html"
		},
		"IndexDocument": {
			"Suffix": "index.html"
		},
		"RoutingRules": [
			{
				"Condition": {
					...
				},
				"Redirect": {
					...
				}
			}
		]
	}

translation:
정적 웹사이트 호스팅 구성을 위한 JSON `STRUCTURE`. 예:
{
"ErrorDocument": {
			"Key": "error.html"
		},
"IndexDocument": {
			"Suffix": "index.html"
		},
"RoutingRules": [
{
"Condition": {
					...
				},
"Redirect": {
					...
				}
}
]
}

id:
A `STRUCTURE` using JSON syntax in a file.
	Example:
	{
		"CORSRules": [
			{
				"AllowedHeaders": ["*"],
				"AllowedMethods": ["PUT", "GET", "DELETE"],
				"AllowedOrigins": ["http://www.example.com"],
				"ExposeHeaders": ["ExposeHeader7", "ExposeHeader8"],
				"MaxAgeSeconds": 75
			}
		]
	}

translation:
JSON 구문을 사용하는 파일 내 `구문`.
 예: 
{
"CORSRules": [
{
				"AllowedHeaders": ["*"],
				"AllowedMethods": ["PUT", "GET", "DELETE"],
				"AllowedOrigins": ["http://www.example.com"],
				"ExposeHeaders": ["ExposeHeader7", "ExposeHeader8"],
				"MaxAgeSeconds": 75
			}
]
}

